import React from 'react'
import { Result, Button } from 'antd';

const Notfound = () => (
  <Result
    status="404"
    title="404"
    subTitle="Sorry, the page you visited does not exist."
    extras={
      <Button type="primary" href="/">Back to dashboard</Button>
    }
    />
)
export default Notfound
